Nouns and prepositional complements pose special problem to compositional approaches to the semantic interpretation of natural language sentences.  Consider the sentence &quot;Chirac was president of France.&quot;  One cannot successfully construct the right semantic interpretation by building a CycL sentence that <i>merely</i> combines the semantics of the &quot;president&quot; (e.g., <a href="http://sw.opencyc.org/concept/Mx4rwJmRJZwpEbGdrcN5Y29ycA" class="cyc_term">PresidentOfOrganization</a>) with those of &quot;of&quot; (say <a href="http://sw.opencyc.org/concept/Mx4rvrG3spwpEbGdrcN5Y29ycA" class="cyc_term">possessiveRelation</a>), as there are lots of ways in which Chirac might be an instance of <a href="http://sw.opencyc.org/concept/Mx4rwJmRJZwpEbGdrcN5Y29ycA" class="cyc_term">PresidentOfOrganization</a> (e.g., he's president of his local book club) and be &quot;of&quot; France (e.g., he was born there). The correct semantics involves recognizing that the noun &quot;president&quot; and its complement form a unit (&quot;president of&quot;) that can be mapped more or less directly to a relation (<a href="http://sw.opencyc.org/concept/Mx4rvVjpxJwpEbGdrcN5Y29ycA" class="cyc_term">president</a>) that can relate the respective denotations of &quot;Chirac&quot; and &quot;France.&quot;
<p/>In many cases where a noun is known to Cyc, we have ways of handling this correctly (see, e.g., <a href="http://sw.opencyc.org/concept/Mx4rvdTpTpwpEbGdrcN5Y29ycA" class="cyc_term">denotesArgInReln</a> and <a href="http://sw.opencyc.org/concept/Mx4rwTX1zJwpEbGdrcN5Y29ycA" class="cyc_term">RelationalNounSlot</a>).  But where a noun is unknown, (e.g., &quot;exclave&quot; in &quot;Cabinda is an exclave of Angola&quot;), the relation is frequently missing, and so must, along with the denotation for the new noun, be first represented in Cyc in order to form a semantic interpretation of the sentence. 
  <code>(<a href="http://sw.opencyc.org/concept/Mx4rcK4qarhiEdqAAAACs71DGQ" class="cyc_term">extractedRelationBasedOnPrepositionInStructure</a> <b>RELN</b> <b>PREP</b> <b>STRUCTURE</b>)</code> means the relation <code><b>RELN</b></code> has been reified by Cyc in order to fill just this sort of ontological gap, made evident by the occurrence of a preposition-string (see <a href="http://sw.opencyc.org/concept/Mx4rvmCvRpwpEbGdrcN5Y29ycA" class="cyc_term">prepositionStrings</a>) associated with the preoposition <code><b>PREP</b></code> in the abstract structure <code><b>STRUCTURE</b></code>.
